package com.baizhi.entity;import java.util.List;/** * Created by dell on 2018/5/29. */public class Menu {    private String id;    private String title;    private String iconCls;    private String parent_id;    private String url;    private List<Menu> childrenlist;    @Override    public String toString() {        return "Menu{" +                "id='" + id + '\'' +                ", title='" + title + '\'' +                ", iconCls='" + iconCls + '\'' +                ", parent_id='" + parent_id + '\'' +                ", url='" + url + '\'' +                ", childrenlist=" + childrenlist +                '}';    }    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getTitle() {        return title;    }    public void setTitle(String title) {        this.title = title;    }    public String getIconCls() {        return iconCls;    }    public void setIconCls(String iconCls) {        this.iconCls = iconCls;    }    public String getParent_id() {        return parent_id;    }    public void setParent_id(String parent_id) {        this.parent_id = parent_id;    }    public String getUrl() {        return url;    }    public void setUrl(String url) {        this.url = url;    }    public List<Menu> getChildrenlist() {        return childrenlist;    }    public void setChildrenlist(List<Menu> childrenlist) {        this.childrenlist = childrenlist;    }    public Menu() {    }    public Menu(String id, String title, String iconCls, String parent_id, String url, List<Menu> childrenlist) {        this.id = id;        this.title = title;        this.iconCls = iconCls;        this.parent_id = parent_id;        this.url = url;        this.childrenlist = childrenlist;    }}